import React from "react";
import { Content, LogoGithub32 } from "carbon-components-react";
import "carbon-components/css/carbon-components.min.css"; // Import Carbon CSS
import "./Hero.css"; // Import your custom styles if needed

const Hero = () => (
    <Content>
        <div className="bx--grid bx--grid--full-width bx--grid--no-gutter text-center hero my-5">
            <LogoGithub32 className="mb-3 app-logo" width={120} />
            <h1 className="mb-4">Carbon React Sample Project</h1>

            <p className="bx--type-expressive-paragraph-01">
                This is a sample application that demonstrates an authentication flow for
                an SPA, using <a href="https://reactjs.org">React.js</a> and the{" "}
                <a href="https://www.carbondesignsystem.com/">Carbon Design System</a>
            </p>
        </div>
    </Content>
);

export default Hero;
